ht place because on The Rubin Report Dave Rubin engages the ideas of some of society's most interesting thought leaders, authors, politicians and comedians. The Rubin Report is the largest talk show about free speech and big ideas on YouTube. \nDave allows his guests to speak their minds and his audience to think for themselves.\nNew videos every week.\n\nThe Rubin Report is fan funded through monthly and one-time donations: http://www.rubinreport.com/support\n\n******\n\nDave Rubin's book, \"Don't Burn This Book\" is now available for pre-order: www.dontburnthisbook.com\n\nLISTEN to The Rubin Report podcast: www.rubinreport.com/podcast\n\nSee Dave LIVE:  https://daverubin.com/events/\n\nSign up for our newsletter with the best of The Rubin Report delivered to your inbox once a month: http://www.rubinreport.com/newsletter\n\nOfficial Rubin Report Merchandise: https://rubinreport.com/shop\n\nAll art on the set are original works by Caylin Rose Janet. \nGet a print here: https://www.caylinrosejanet.com/rubinreportart.html\n\n******\n\nBen Shapiro\nEditor-in-Chief, the Daily Wire\nBen on Twitter: https://twitter.com/benshapiro\nBen on YouTube: https://www.youtube.com/thedailywire\n\n******\nFollow Dave on Twitter: https://twitter.com/RubinReport\nFollow The Rubin Report on Facebook: https://www.facebook.com/rubinreport\nFollow Dave on Facebook: https://www.facebook.com/daverubin\nAbout Dave Rubin: http://daverubin.com/","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/s9IwamztdqA/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDBacJqzJ34Bw6DjRzMYK734uK18A","width":168,"height":94},{"url":"https://i.ytimg.com/vi/s9IwamztdqA/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDDgz1nM20PbQkS0ktUm1twtDY6ig","width":196,"height":110},{"url":"https://i.ytimg.com/vi/s9IwamztdqA/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLAsmprO
